INSERT INTO `message_board_tbl` VALUES ('8', 'SMU Health Center', '<p>The&nbsp;<a href=\"http://www.smu.edu/StudentAffairs/HealthCenter\">SMU Health Center</a>&nbsp;is relocating to Perkins Hall, 6004 Hillcrest Ave., on Tuesday, August 4, and will provide medical and other services beginning at 1 p.m.</p><p>Starting Wednesday, August 5, the Health Center will&nbsp;maintain&nbsp;<a href=\"http://www.smu.edu/StudentAffairs/HealthCenter/GeneralInformation/Hours\">normal operating hours&nbsp;</a>of 8:30 a.m. to 5 p.m. Mondays through Fridays at Perkins Hall. Appointments will be&nbsp;available from 8:30 a.m. to 4 p.m.; call 214-768-2141.&nbsp;</p><p>The Health Center\'s permanent home, the new Dr. Bob Smith Health Center, is under construction and expected to be completed in 2016.</p><p><br></p><p><br></p><p>Thanks,</p><p>Nagendra</p>', 'Health Center', 'admin', , '2015-08-05 14:06:08');
